import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

const MonthlyChart = ({ data }) => {
    return (
        <BarChart width={600} height={400} data={data} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="month" />
            <YAxis yAxisId="left" label={{ value: 'Đơn vị M3', angle: -90, position: 'insideLeft' }} />
            <YAxis
                margin={{ top: 5, right: 30, left: 400, bottom: 5 }}
                yAxisId="right"
                label={{ value: 'Đơn vị nghìn VND', angle: -90, position: 'insideRight' }}
                orientation="right"
            />
            <Tooltip />
            <Legend />
            <Bar yAxisId="left" dataKey="usage" fill="#8884d8" />
            <Bar yAxisId="right" dataKey="amount" fill="#82ca9d" />
        </BarChart>
    );
};

export default MonthlyChart;
